import React, { Component } from 'react'
import "./App.css";

class ListProducts extends Component {

  state = {  }

  componentDidMount = async () => {
  };


  render() {
    return (
      <div className="App">
        <h1>Airdrop</h1>
        {this.props.nfts.map((nft, key) => {
          if (nft.purpose == 0) {
            return (
              <div class="nft">
                <h2>{nft.title}</h2>
                <p>Id: {nft.id}</p>
                <img id="ipfs-image" src={`https://ipfs.infura.io/ipfs/${nft.image}`} alt="IPFS Upload"/>
                <p>{nft.description}</p>
                <p>Price: {nft.price}</p>
                <p>Status: {nft.status == 0 ? "Unclaimed" : "Claimed"}</p>
                <button>Claim</button>
              </div>
            );
          }
        })}
      </div>
    );
  }
}

export default ListProducts;
